import React from "react";
import { NavLink } from "react-router-dom";

const SubmitModal = ({ open, setOpen }) => {
  return (
    <>
      {open && (
        <div className=" bg-black/75 fixed inset-0">
          <div className="relative w-full h-full">
            <div className="flex flex-col items-center justify-center gap-7  mt-16 ">
              {/* title */}
              <p className="text-[60px] text-[#fff] w-[280px] leading-[52px] font-normal text-center">
                Thank You For Your Review
              </p>

              <img src="/images/tick.svg" />
              <NavLink
                to={"/product"}
                type="button"
                className="px-32 py-5 bg-[#A7AE45] rounded-[10px] font-family text[24px]  text-[#fff] font-normal"
                onClick={() => setOpen((prev) => !prev)}
              >
                Close
              </NavLink>
            </div>
          </div>
        </div>
      )}
    </>
  );
};

export default SubmitModal;
